import { Edit } from "./Edit";
import { Label } from "./Label";


export class IPAddress extends Label{

    getIP():number;
    setIP(ip:number):void;
    isReadOnly():boolean;
    setReadOnly(readOnly:boolean):void;
    updateText():void;
}


export class IPAddressEx extends Edit{
    getIP():string;
    setIP(ip:string):void;
}
